"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[362],{64760:e=>{e.exports=JSON.parse('{"functions":[{"name":"start","desc":"Initializes your Routes by adding middleware to your Matter Loop.\\nThis ensures that your Routes run between each frame.\\n\\n:::note\\nPlease make sure that the event you set in the Configuration, or the default, is the same index you used for your\\n``RunService.Heartbeat`` event in your ``Loop:begin()`` method.\\n\\nYour Routes are meant to run on the heartbeat, like most systems. In some cases you may want to run your Routes on different events,\\nin this case it is acceptable to change it to a different event.\\n:::","params":[{"name":"loop","desc":"A Matter Loop","lua_type":"Loop"},{"name":"routes","desc":"A table of your Routes","lua_type":"{ Route }"}],"returns":[],"function_type":"static","source":{"line":361,"path":"lib/init.luau"}},{"name":"createHook","desc":"This function allows you to run Net scheduling code on your own events.\\n\\nWhen you provide a table of Routes, this function will return another function\\nyou can call which will step each Route and process it\'s Packet Queue.\\n\\nFor example, to run scheduling on the Heartbeat:\\n```lua\\nlocal hook = Net.createHook({ Route })\\nRunService.Heartbeat:Connect(hook)\\n```","params":[{"name":"routes","desc":"A table of your Routes","lua_type":"{ Net }"}],"returns":[{"desc":"","lua_type":"() -> ()"}],"function_type":"static","source":{"line":422,"path":"lib/init.luau"}}],"properties":[{"name":"server","desc":"A unique identifier used for to identify the Server when sending/querying.","lua_type":"\\"Net_Server\\"","source":{"line":438,"path":"lib/init.luau"}},{"name":"Route","desc":"A uniquely identified Object responsible for handling queries and send requests.","lua_type":"Route","source":{"line":442,"path":"lib/init.luau"}}],"types":[],"name":"Net","desc":"Net is a networking library for Roblox, or rather its a library that wraps around Roblox\'s RemoteEvents to solve certain issues and provide new API for networking on Roblox.\\n\\nSome of the issues this library solves are:\\n- Overhead from RemoteEvents\\n- Ordering of Networking Events\\n- Lack of Type-Checking and Intellisense for working with RemoteEvents\\n\\nNet also provides several utilities:\\n- Middleware\\n- Strict Type-Checking & Auto-completion\\n- Simple integration with Hooks\\n- Data-driven Design\\n\\nYou can learn more about how Net works and how to use it by visiting [Getting Started with Routes](/docs/getting-started/routes).\\nOr, you can keep reading to learn more about the technical details and design choices that went into creating Net in the [Introduction](/docs/intro).","source":{"line":462,"path":"lib/init.luau"}}')}}]);